import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <div class="barre">
        <br></br>
        <div class = "texte_header">Lacanau - qualité des eaux à la date du dd/mm/yyyy</div>
        <br></br>
      </div>
      </header>
      <div class = "texte1"> Taux de pollution du jour : XX</div>
      <div class = "arrow"> <img alt="Une fleche" width="200" height="600" src={ require('./arrow.png') } /> </div>
    </div>
  );
}

export default App;
